import { Link } from 'react-router-dom';
// import LandingLogo from '../../../images/landing-logo.svg';

function NavTab() {
  return (
    <div className="nav-tab__login">
      <Link to="/signup" className="nav-tab__login-link">
        Регистрация
      </Link>
      <Link to="/signin" className="nav-tab__login-link">
        Войти
      </Link>
    </div>
  );
}

export default NavTab;
